import struct
from datetime import datetime, timedelta

def bytes_to_datetime(b):
    ticks = struct.unpack('Q',bytes([int(x,16) for x in b.split(' ')]))[0]
    return ticks_to_datetime(ticks)

def ticks_to_datetime(ticks):
    csharp_epoch = datetime(1, 1, 1)
    ticks_duration = timedelta(microseconds=ticks / 10-(7*3600*1000000))
    result_datetime = csharp_epoch + ticks_duration
    return result_datetime

